// SPDX-License-Identifier: MIT

pragma solidity ^0.7.0;

import './libraries/Ownable.sol';
import './libraries/TacoLibrary.sol';
import './interfaces/ITacoFactory.sol';
import './IndexFundV1.sol';

/// @author Kindynos
/// @title The contract that deploys and controls IndexFunds.
contract TacoController is ITacoFactory, Ownable {
    address public override feeTo;

    mapping(bytes32 => address) public fundData;
    address[] public override allFunds;

    /**
     * @notice retrieves the address of the IndexFund, if it exists.
     * @param _tokenArray the array of addresses that make the fund.
     */
    function getFund(address[] memory _tokenArray) external override view returns (address fund){
        _tokenArray = TacoLibrary.sortTokens(_tokenArray);
        return fundData[keccak256(abi.encodePacked(_tokenArray))];
    }

    /// @notice returns the total amount of different Index Funds.
    function allFundsLength() external override view returns (uint) {
        return allFunds.length;
    }

    /// @notice gets the codeHash of the IndexFund base contract.
    function fundCodeHash() external pure returns (bytes32) {
        return keccak256(type(IndexFundV1).creationCode);
    }

    /**
     * @notice Creates an Index Fund.
     * @param _tokenArray The token addresses that make the fund.
     * @param _proportionsArray The amounts of the respective tokens that represent a (1) unit of the Fund Token
     */
    function createFund(
        address[] memory _tokenArray,
        uint256[] memory _proportionsArray)
        external override onlyOwner returns (address fund) {
        // sort tokens. This is the same function as then library, but using two arrays instead of one.
        for (uint i = 1; i < _tokenArray.length; i++) {
            address key = _tokenArray[i];
            uint256 key2 = _proportionsArray[i];
            uint j = i - 1;
            while ((int(j) >= 0) && (_tokenArray[j] > key)) {
                _tokenArray[j + 1] = _tokenArray[j];
                _proportionsArray[j + 1] = _proportionsArray[j];
                j--;
            }
            _tokenArray[j + 1] = key;
            _proportionsArray[j + 1] = key2;
        }

        // hashed array is also salt
        bytes32 hashedArray = keccak256(abi.encodePacked(_tokenArray));
        require(fundData[hashedArray] == address(0), 'TacoFinance: FUND_EXISTS');
        bytes memory bytecode = type(IndexFundV1).creationCode;
        assembly {
        fund := create2(0, add(bytecode, 32), mload(bytecode), hashedArray)
        }
        IndexFundV1(fund).initialize(_tokenArray, _proportionsArray);
        fundData[hashedArray] = fund;
        allFunds.push(fund);
        emit FundCreated(_tokenArray, fund, allFunds.length);
    }

    /**
      * @notice Sets the address that receives the dev Fees if activated.
      * @dev IndexFundV1 does not have any dev fees.
      * @param _feeTo The address that receives the fees.
      */
    function setFeeTo(address _feeTo) external override onlyOwner {
        feeTo = _feeTo;
    }


    /**
      * @notice Changes the vaults on which the fund's tokens are invested. Can be set to the 0 address to disable investing.
      * @param _tokenArray The token addresses that make the fund.
      * @param _newVaults The addresses of the new vaults.
      */
    function setVaults(address[] memory _tokenArray, address[] memory _newVaults) external override onlyOwner {
        _tokenArray = TacoLibrary.sortTokens(_tokenArray);
        address fundAddr = fundData[keccak256(abi.encodePacked(_tokenArray))];
        require(fundAddr != address(0), 'TacoFinance: NO_FUND');
        IndexFundV1 fund = IndexFundV1(fundAddr);
        fund.setVaults(_newVaults);
        emit FundVaultsChanged(fundAddr, _newVaults);
    }

    /**
      * @notice Modify amount that is invested from an IndexFund
      * @dev The denominator is 1000.
      * @param _tokenArray The token addresses that make the fund.
      * @param _numerator The new numerator.
      */
    function setInvestingNumerator(address[] memory _tokenArray, uint256 _numerator) external override onlyOwner {
        _tokenArray = TacoLibrary.sortTokens(_tokenArray);
        address fundAddr = fundData[keccak256(abi.encodePacked(_tokenArray))];
        require(fundAddr != address(0), 'TacoFinance: NO_FUND');
        IndexFundV1 fund = IndexFundV1(fundAddr);
        fund.setInvestingNumerator(_numerator);
    }

    /**
      * @notice @notice Set if an IndexFund has the 0.05 exit Fee.
      * @dev The fee is kept in the Fund for the other users, is not a dev fee.
      * @param _tokenArray The token addresses that make the fund.
      * @param _withFee If the fee is active or not.
      */
    function switchExitFee(address[] memory _tokenArray, bool _withFee) external override onlyOwner {
        _tokenArray = TacoLibrary.sortTokens(_tokenArray);
        address fundAddr = fundData[keccak256(abi.encodePacked(_tokenArray))];
        require(fundAddr != address(0), 'TacoFinance: NO_FUND');
        IndexFundV1 fund = IndexFundV1(fundAddr);
        fund.setExitFee(_withFee);
        emit FundExitFee(fundAddr, _withFee);
    }

}

